// eslint-disable-next-line
import React, { useState } from "react";
import "../Home/HomeCSS/HomeMain.css";
import { BrowserRouter as Router } from "react-router-dom";
// Material UI Imports
import { Button } from "@material-ui/core";
import Modal from "@material-ui/core/Modal";

import Body2 from "./Body2";
// Image Imports
import photo from "./HomeImages/Star Logo 07-2.png";
import flag1 from "./HomeImages/Maori flag.png";
import flag2 from "./HomeImages/NZ Flag.png";
import user from "./HomeImages/Projects 01.png";
import hero from "./HomeImages/Projects 02.png";

import { Teacher, Student } from "./Login-Signup";

const Home = () => {
  const [open, setOpen] = useState(false);
  const [open2, setOpen2] = useState(false);

  const handleOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
    setOpen2(false);
  };

  const handleOpen2 = () => {
    setOpen2(true);
  };

  const handleClick = () => {
    if (open === true) {
      setOpen(false);
      setOpen2(true);
    } else if (open2 === true) {
      setOpen2(false);
      setOpen(true);
    }
  };

  return (
    <div>
      <Modal open={open} onBackdropClick={handleClose}>
        <Teacher
          handleClick={handleClick}
          handleClose={handleClose}
          onBackdropClick={handleClose}
        />
      </Modal>

      <Modal open={open2} onBackdropClick={handleClose}>
        <Student
          handleClick={handleClick}
          handleClose={handleClose}
          onBackdropClick={handleClose}
        />
      </Modal>

      <div className="topNav">
        <Router>
          <div className="logo">
            <img className="img-main" src={photo} alt="logo" />
          </div>

          <div className="navLinks">
            <ul>
              <a
                href=""
                className="navBar-link"
                target="blank"
                rel="noopener noreferrer"
              >
                <li>Home</li>
              </a>
              <a href="" className="navBar-link mid-link">
                <li>Features</li>
              </a>
              <a href="" className="navBar-link">
                <li>Teachers</li>
              </a>
            </ul>
          </div>
          <div className="sign">
            <div className="langDiv">
              <p className="langNav">
                lang
                <img className="img-flag langNav" src={flag2} alt="logo" />
                <img className="img-flag langNav" src={flag1} alt="logo" />
              </p>
            </div>

            <p>
              <img className="usericon" src={user} alt="logo" />
              <button className="modalOpenButtons" onClick={handleOpen}>
                Sign 
              </button>{" "}
              |{" "}
              <button className="modalOpenButtons" onClick={handleOpen2}>
                LOG IN
              </button>
            </p>
          </div>
        </Router>
      </div>

      <div className="header">
        <img className="hero" src={hero} alt="header" />
      </div>

      <div className="stuff">
        <p>main stuff</p>
      </div>

      <Body2 />

      <div className="enroll">
        <p>enroll</p>
        <Button size="small" type="button" onClick={handleOpen}>
          Submit
        </Button>
      </div>

      <div className="footer">
        <p>footer</p>
      </div>
    </div>
  );
};

export default Home;
